  \"Arrowwood National Wildlife Refuge, Chase Lake National Wildlife Refuge, Half-Way
  Lake Easement Refuge, Hobart Lake Easement Refuge, Stoney Slough Easement Refuge,
  Tomahawk Easement Refuge : Narrative report : Calendar year - 1968\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 12,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:43:02.140139\",\n\t\"name\": \"arrowwood-national-wildlife-refuge-chase-lake-national-wildlife-refuge-half-way-lake-easem\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  NWR (including Chase Lake NWR and the easement refuges) outlines Refuge accomplishments
  during the 1968 calendar year. The report begins by summarizing the weather conditions,
  habitat conditions, water conditions, and food and cover conditions during the year.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, collections
  and receipts, vegetation control, and prescribed burning. Resource management is
  outlined; topics include grazing and fur harvesting. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, and photographs are
  attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
